import './App.css';

function App() {
  return(
    <div className="App">
      <User name="sajith" age={21} email="sajith@techis.io"/>
      <User name="john" age={34} email="something@gmail.com"/>
      <User name="alex" age={23} email="something@gmail.com1"/>/>

    </div>
  ); 



}


const props ={
  name: "sajith",
  age: 25,
  email: 'sajith@techis.io'
}

const User = (props) => {
  return (
    <div>
      <h1>{props.name}</h1>
      <h2>{props.age}</h2>
      <h2>{props.email}</h2>
    </div>
  );
};

export default App;
